import React from 'react'

export default function customersmall(props) {
    let content=props.customers.map((customer,index) => {
        return (
            <div key={index} className="card">
                        <div className="card-body">
                            <h6>{customer.name}</h6>
                            <h6> Rs {customer.amount}</h6>
                        </div>
            </div>
        )
    })
    return (
        <div>
            <table>
                <tbody>
                    {content}
                </tbody>
            </table>
        </div>
    )
}
